VALUES ('7630030301391', 'Dark chocolate', 'Cocoa mass, Sugar, Cocoa butter, Butter (milk) fat, Vanilla extract May contain milk, nuts, wheat and egg. Cocoa solids: 70% minimum. Store in a cool and dry place. Best before: see below 40 CARRÉS DE CHOCOLAT NOIR Ingrédients: pâte de cacao, sucre, beurre de cacao, beurre anhydre, extrait de vanille. Peut contenir du lait, fruits à coque, blé et œuf. A conserver au sec et à l\'abri de la chaleurs Cacao: 7096 minimum. A consommer de préférence avant le: voir ci-dessous. 40 TÂFELCHEN AUS BITTERSCHOKOLADE Zutaten: Kakaomasse, Zucker, Kakaobutter, Butterreinfett, Vanille-Extrakt. Kann Milch, Nüsse, Weizen und Ei enthalten. Kakao: 70% mindestens. Trocken lagern. Vor Wârme schützen. Mindestens haltbar bis: siehe unten. 40 QUADRATINI Dl CIOCCOLATO FONDENTE Ingredienti: pasta di cacao, zucchero, burro di cacao, burro anidro, estratto di vaniglia. Pub contenere latte, frutta a guscio, cereali contenenti glutine e uovas Cacao: 70% minimo, Conservare in luogo asciutto e lontano da fonti di calore. Da consumarsi preferibilmente entro il: vedi sotto.', 'https://static.openfoodfacts.org/images/products/763/003/030/1391/front_fr.4.400.jpg', '44.9', '26.6', '30.7', '26.4', '15.3', '8', '0.02', '0.0078740157480315', '', '0');

