INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7630039695620', 'COLOMBIA', 'MASTER ORIGIN Colombia contient un Arabica cueill en récolte tardive, produit par quelques fermiers sélectionnés et audacieux. Ils laissent les cerises de café mürir sur les arbres plus longtemps que d\'habitude. Cette pratique permet d\'obtenir un résultat en tasse à la fois éclatant et vif, agrémenté de notes de vin et de fruits rouges. Intensité 6. MASTER ORIGIN Colombia contains late harvest Arabica, produced by a select few, courageous farmers. They leave coffee cherries to ripen on trees for longer than usual. The resulting cup is bright, vivacious, with winey and red fruit notes. Intensity 6. MASTER ORIGIN Colombia is een koffie van laat geoogste Arabica-bonen, verbouwd door een kleine groep toegewijde boeren. Ze laten de koffiebessen net wat langer rijpen dan gebruikelijk. Het resultaat is een lichte, levendige koffie, met tonen van wijn en rode vruchten. Intensiteit 6.', 'https://static.openfoodfacts.org/images/products/763/003/969/5620/front_fr.6.400.jpg', '', '', '', '', '', '', '', '', '', '1');

