INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7630047675867', 'Nespressi chiaro', 'ER Envie d\'un peu de douceur ? La douceur de BARISTA CREATIONS Chiaro, imaginé pour révéler le mariage deélicat du café et du lait, porte la promesse d\'un agreable moment. Ce mélange d\'Arabicas kenyans et indonésiens soigneusement sélectionnés et torrefiés treès légèrement révele de délicieuses notes de caramel et de biscuit lors de lajout d\'un nuage de lait. Pour une dégustation idéale:25 ml de café (longueur de tasse Ristretto) nappés de 60 ml de mousse de lait. Donnez libre cours à votre créativité avec nos recettes sur www.nespresso.com EN Would you like a litle indulgence? You can do this with BARISTA CREATIONS Chiaro because it was designed to harmonise coffee with milk. A carefully selected blend of Kenyan and Indonesian Arabicas gets our lightest roast ever, so when you add milk, it reveals those delicious caramel and sweet biscuit notes. Best served as: 25ml (Ristretto cup size) of coffee and 60ml of frothed milk on top. Unlock your creativity with our recipes on www.nespresso.com Hebje zin om echtte genieten? De BARISTA CREATIONS Chiaro is speciaal gemaakt voor momenten waarop je koffie met opgeschuimde melk wilt combineren. Een zorgvuldig geselecteerde blend van Arabica\'s uit Kenia en Indonesië heeft de lichtste branding gekregen die er bestaat, zodat de koffie warme tonen van karamel en zoete biscuit onthult als je de melkschuim toevoegt.Serveersuggestie:bereid 25 ml koffie (ristretto) en schenk daarop 60 ml wam melkschuim. Ga zelf aan de slag met onze recepten op www.nespresso.com T', 'https://static.openfoodfacts.org/images/products/763/004/767/5867/front_fr.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

